// Enhanced WhatsApp message processing with smart intent detection
const webhookData = $input.first().json;
const entry = webhookData.entry?.[0];
const messageData = entry?.changes?.[0]?.value?.messages?.[0];
const contactData = entry?.changes?.[0]?.value?.contacts?.[0];

if (!messageData) {
  return [{ json: { error: 'No message data found' } }];
}

// Extract message details
const messageText = messageData.text?.body || '';
const fromNumber = messageData.from;
const messageId = messageData.id;
const timestamp = messageData.timestamp;
const messageType = messageData.type;

// Extract contact info
const customerName = contactData?.profile?.name || 'Customer';

// Enhanced message analysis
const cleanMessage = messageText.toLowerCase().trim();

// Advanced intent detection
let intent = 'general';
let confidence = 0.5;
let entities = {
  cuisines: [],
  dietary: [],
  priceLevel: null,
  amenities: [],
  location: null
};

// Intent classification with confidence scoring
if (cleanMessage.includes('find') || cleanMessage.includes('search') || cleanMessage.includes('show') || cleanMessage.includes('looking for')) {
  intent = 'search';
  confidence = 0.9;
} else if (cleanMessage.includes('book') || cleanMessage.includes('reserve') || cleanMessage.includes('table')) {
  intent = 'booking';
  confidence = 0.9;
} else if (cleanMessage.includes('help') || cleanMessage.includes('menu') || cleanMessage.includes('what can you')) {
  intent = 'help';
  confidence = 0.9;
} else if (cleanMessage.includes('list') || cleanMessage.includes('all restaurants')) {
  intent = 'list_all';
  confidence = 0.8;
}

// Entity extraction
// Cuisines
const cuisinePatterns = {
  'italian': ['italian', 'pizza', 'pasta', 'mario', 'luigi', 'bella'],
  'chinese': ['chinese', 'dragon', 'wok', 'beijing', 'szechuan'],
  'japanese': ['japanese', 'sushi', 'ramen', 'tokyo', 'hibachi'],
  'mexican': ['mexican', 'taco', 'burrito', 'salsa', 'cantina'],
  'indian': ['indian', 'curry', 'masala', 'tandoor', 'spice'],
  'thai': ['thai', 'pad', 'som', 'tom', 'bangkok'],
  'american': ['american', 'burger', 'grill', 'diner', 'bbq'],
  'french': ['french', 'bistro', 'cafe', 'brasserie']
};

for (const [cuisine, patterns] of Object.entries(cuisinePatterns)) {
  if (patterns.some(pattern => cleanMessage.includes(pattern))) {
    entities.cuisines.push(cuisine);
  }
}

// Dietary restrictions
const dietaryPatterns = ['vegetarian', 'vegan', 'gluten-free', 'halal', 'kosher', 'dairy-free', 'nut-free', 'keto', 'paleo'];
for (const dietary of dietaryPatterns) {
  if (cleanMessage.includes(dietary) || cleanMessage.includes(dietary.replace('-', ' '))) {
    entities.dietary.push(dietary);
  }
}

// Price level detection
if (cleanMessage.includes('cheap') || cleanMessage.includes('budget') || cleanMessage.includes('affordable')) {
  entities.priceLevel = 1;
} else if (cleanMessage.includes('expensive') || cleanMessage.includes('upscale') || cleanMessage.includes('fine dining')) {
  entities.priceLevel = 4;
} else if (cleanMessage.includes('mid-range') || cleanMessage.includes('moderate')) {
  entities.priceLevel = 2;
}

// Amenities detection
if (cleanMessage.includes('outdoor') || cleanMessage.includes('patio')) {
  entities.amenities.push('outdoor_seating');
}
if (cleanMessage.includes('delivery')) {
  entities.amenities.push('delivery');
}
if (cleanMessage.includes('takeout')) {
  entities.amenities.push('takeout');
}
if (cleanMessage.includes('parking')) {
  entities.amenities.push('parking');
}

// Location detection
if (cleanMessage.includes('near me') || cleanMessage.includes('nearby') || cleanMessage.includes('close')) {
  entities.location = 'nearby';
}

// Smart query enhancement based on entities
let enhancedQuery = messageText;
if (entities.cuisines.length > 0 || entities.dietary.length > 0 || entities.priceLevel || entities.amenities.length > 0) {
  const queryParts = [];

  if (entities.cuisines.length > 0) {
    queryParts.push(entities.cuisines[0] + ' restaurants');
  }

  if (entities.dietary.length > 0) {
    queryParts.push('with ' + entities.dietary.join(' and ') + ' options');
  }

  if (entities.priceLevel) {
    const priceLevels = {1: 'cheap', 2: 'moderate', 3: 'upscale', 4: 'expensive'};
    queryParts.push(priceLevels[entities.priceLevel]);
  }

  if (entities.amenities.length > 0) {
    queryParts.push('with ' + entities.amenities.join(' and '));
  }

  if (queryParts.length > 0) {
    enhancedQuery = queryParts.join(' ');
  }
}

// Return processed data with enhanced structure
return [{
  json: {
    originalWebhook: webhookData,
    processedMessage: {
      messageText: messageText,
      enhancedQuery: enhancedQuery,
      cleanMessage: cleanMessage,
      fromNumber: fromNumber,
      customerName: customerName,
      messageId: messageId,
      timestamp: timestamp,
      intent: intent,
      confidence: confidence,
      entities: entities,
      // Prepare request for enhanced API
      apiRequest: {
        message: enhancedQuery,
        phone: fromNumber,
        intent: intent,
        filters: {
          cuisines: entities.cuisines,
          dietary: entities.dietary,
          priceLevel: entities.priceLevel,
          amenities: entities.amenities,
          location: entities.location
        },
        context: {
          customerName: customerName,
          messageId: messageId,
          timestamp: timestamp,
          confidence: confidence
        }
      }
    }
  }
}];

